import React,{useContext} from 'react';
import {Link} from 'react-router-dom';
import {Grid, Card, Paper, Container }from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import {PropertyContext} from '../context/context';
import { makeStyles } from '@material-ui/core/styles';
import ButtonBase from '@material-ui/core/ButtonBase';

const useStyles = makeStyles((theme) => ({
    Head:{
        color: "#F9F3FA"
    },
    Paper:{
        background:"#1C191D",
        borderRadius: 15,
        padding: 8
    }
  }));

export default function PropertyList() {
    const classes = useStyles();
    const context = useContext(PropertyContext)
    return (
        <Paper className={classes.Paper} >
            <Typography className={classes.Head}>15 Search result</Typography>
            <Grid container spacing={1}>
                {context.initialData.map((card)=>(
                    <Grid item key={card.id} xs={12} >
                        <div className={classes.root}>
                            <Paper className={classes.paper} elevation={5}>
                                <Grid container spacing={2}>
                                    <Grid item>
                                        <Link  to={`/DetailPage/${card.id}`} >
                                            <ButtonBase className={classes.image}>
                                                <img className={classes.img} alt="complex" src={card.url[0]} />
                                            </ButtonBase>
                                        </Link>
                                    </Grid>
                                    <Grid item xs={12} sm container>
                                        <Grid  container>
                                            <Grid item xs container direction="column" spacing={2}>
                                                <Grid item xs>
                                                    <h1 className={classes.Address}>
                                                        {"hi"}
                                                    </h1>
                                                    <p className={classes.publicText}>
                                                        {"hi"}
                                                    </p>
                                                </Grid>
                                            </Grid>
                                            <Grid item>
                                                {/* <NumberFormat className={classes.Price} value={card.ListPrice} displayType={'text'} thousandSeparator={true} prefix={'$'} /> */}
                                                {/* {card.CountyOrParish} */}
                                            </Grid>
                                        </Grid>
                                        <Grid item container >
                                            <Grid item style={{width:'100%'}}>
                                                <div className={classes.controls}>
                                                    <h5 className={classes.treeLogo}>
                                                        <img src={nwmlsImage} alt='NWMLS' style={{height:"25px"}}/>
                                                        Listing courtesy of {card.ListOfficeName}
                                                    </h5>
                                                    <Link  to={`/DetailPage/${card.id}`} style={{marginLeft : "auto", textDecoration: 'none'}} >
                                                        <Button className={classes.tourButton} startIcon={<ArrowForwardIosIcon />} size="small" variant="contained">
                                                            Tour Now
                                                        </Button>
                                                    </Link>
                                                </div>
                                            </Grid>
                                        </Grid>
                                    </Grid>
                                </Grid>
                            </Paper>
                        </div>
                    </Grid>
                ))}
            </Grid>
        </Paper>
    )
}
